import React from "react";


const User = ({ usuario }) => (
 
<div className="repoListContainer">
   <li></li>
   <li></li>
   <li></li>
    <div>Avatar:{usuario.avatar_url}</div>
    <div>Login:{usuario.login}</div>
    <span>{usuario.id}</span>
</div>


);




export default User;
